script: |
  super -f text -I q9405.spq | sort > q9405.out

inputs:
  - name: q9405.spq
    data: |
      SELECT ALL col0 + - col1 * + tab1.col1 * col0 FROM tab1 (FORMAT parquet) WHERE NOT col0 + - col0 * tab1.col1 + - col1 NOT IN ( - col1 + col2 / - col1 + col1 * col0 );
  - name: tab1

outputs:
  - name: q9405.out
    data: |
